import React, { lazy, Suspense, useEffect, useState } from "react";
import { ICoin } from "./interface";
import Pagination from "./Pagination";

const Coin: React.FC = () => {
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(10);
  const [coinsData, setCoinsData] = useState<ICoin[]>([]);

  const handlePrevPage = (prevPage: number) => {
    setPage((prevPage) => prevPage - 1);
  };

  const handleNextPage = (nextPage: number) => {
    console.log(nextPage);
    setPage((nextPage) => nextPage + 1);
  };

  useEffect(() => {
    console.log("effct");
    let token = localStorage.getItem("id_token");
    // const fetchData = async () => {
    //   const response = await fetch(
    //     `http://localhost:8080/api/user/shipping?page=${page}`
    //   );
    //   const result = await response.json();
    //   console.log(result);
    //   setCoinsData(result);
    //   setTotalPages(totalPages);
    // };
    setFetchShipping: () => {
      let token = localStorage.getItem("id_token");
      console.log(token, "=======================================");
      set(() => ({ loading: true, dataFilter: [] }));
      axios
        .get("http://localhost:8080/api/user/shipping", {
          headers: {
            Authorization: `${token}`,
          },
        })
        .then((response) => {
          console.log(response, "WGDWQYUDGQFDWFQFDUQFQWYDF");
          set(() => ({
            shippingDatas: response.data.data.data,
            loading: false,
            message: response.statusText,
          }));
          console.log(response.data.data, "3243");
          set((state) => {
            const dataShowFilter = showFilter(
              ShowFilterType.LAST_10_TRX,
              state.shippingDatas
            );

            const dataSort = sortBy(
              SortByType.DATE,
              SortType.DESC,
              dataShowFilter
            );

            const dataSearch = searchDescription("", dataSort);

            return { dataFilter: dataSearch };
          });
        })
        .catch((err) => {
          set(() => ({
            error: true,
            loading: false,
            message: err.response.data.message,
          }));
          console.log(err);
        });
    },
      fetchData();
  }, [page]);
  return (
    <>
      <table className="table" width="80%">
        <thead>
          <tr>
            <th>Cryptocurrencies</th>
            <th>Price</th>
            <th>24H Change</th>
            <th>Market Cap</th>
          </tr>
        </thead>
      </table>
      {coinsData.map((coin) => {
        return (
          <div id={coin.id} key={coin.id}>
            <h1>{coin.name} </h1>
          </div>
        );
      })}

      <Pagination
        totalPages={totalPages}
        currentPage={page}
        handlePrevPage={handlePrevPage}
        handleNextPage={handleNextPage}
      />
    </>
  );
};

export default Coin;
